const wordsAssembler = (words) => {
  return (
    words.map(word => (
      <span>
        {word}
      </span>
    ))
  );
};


const WordDisplay = (props) => {
  const { words } = props;
  const allWords = wordsAssembler (words);
  return(<p>
    {allWords}
  </p>);
};

export default WordDisplay;
